import React, { useState, useEffect } from 'react';
import { Worker, Viewer } from '@react-pdf-viewer/core';
import '@react-pdf-viewer/core/lib/styles/index.css';
import { useParams } from 'react-router-dom';
import * as PDFJS from 'pdfjs-dist';

const PDFViewer = () => {
  const { pdfId } = useParams();
  const [pdfUrl, setPdfUrl] = useState<string | null>(null);

  useEffect(() => {
    const corsAnywhereUrl = 'https://cors-anywhere.herokuapp.com/';
    const awsBaseUrl = 'https://dpesc-diario-oficial.s3.amazonaws.com/posts/';
    const pdfParams = `AWSAccessKeyId=AKIA35JIBPLBGPSSBFO5&Signature=wkpDoirx35OUZrXdgWXcy1VfqVg%3D&Expires=1705600009`;

    const constructedPdfUrl = `${corsAnywhereUrl}${awsBaseUrl}${pdfId}?${pdfParams}`;

    fetch(constructedPdfUrl)
      .then(response => response.blob())
      .then(blob => {
        const localPdfUrl = URL.createObjectURL(blob);
        setPdfUrl(localPdfUrl);
      })
      .catch(error => {
        console.error('Erro ao baixar o PDF:', error);
      });
  }, [pdfId]);

  return (
    <div>
      <h2>PDF Viewer</h2>
      <div>
        {pdfUrl && (
          <Worker workerUrl={`data:application/pdf;base64,${btoa(PDFJS.GlobalWorkerOptions.workerSrc)}`}>
            <Viewer fileUrl={''} />
          </Worker>
        )}
      </div>
    </div>
  );
};

export default PDFViewer;
